import React from 'react';
import { ProductCard } from '../components/ProductCard';

type Product = {
  id: string;
  title: string;
  price: number;
  description: string;
  image?: string;
};

const PRODUCTS: Product[] = [
  { id: 'p1', title: '智能手环', price: 19.99, description: '简短描述，实用且时尚。' },
  { id: 'p2', title: '蓝牙耳机', price: 49.99, description: '高保真音质，佩戴舒适。' },
  { id: 'p3', title: '迷你智能音箱', price: 29.99, description: '小巧好用，声音清晰。' },
  { id: 'p4', title: '无线充电器', price: 12.99, description: '兼容多设备，快充。' },
  { id: 'p5', title: '智能水杯', price: 22.0, description: '保温保鲜，时尚设计。' },
  { id: 'p6', title: '运动手表', price: 89.0, description: '多功能健康监测。' },
];

export const ProductsPage: React.FC = () => {
  return (
    <div className="products-page container">
      <h1 className="page-title">最新产品</h1>
      <div className="product-grid">
        {PRODUCTS.map((p) => (
          <ProductCard
            key={p.id}
            title={p.title}
            price={p.price}
            description={p.description}
            image={p.image}
          />
        ))}
      </div>
    </div>
  );
};
